import React from 'react';
import './App.css';
import { NeuCard } from 'neumorphic-ui';

function App() {
  return (
    <div>
      <h1>Hello World</h1>
      <NeuCard>
        <h1> Testing inside the card </h1>
      </NeuCard>
    </div>
  );
}

export default App;
